import styled from 'styled-components';
import Button from '@material-ui/core/Button';
import { CandyMachineAccount } from './candy-machine';
import { CircularProgress } from '@material-ui/core';
import { GatewayStatus, useGateway } from '@civic/solana-gateway-react';
import { useEffect, useState, useRef } from 'react';
import { useConnection, useWallet } from '@solana/wallet-adapter-react';
import {
  findGatewayToken,
  getGatewayTokenAddressForOwnerAndGatekeeperNetwork,
  onGatewayTokenChange,
  removeAccountChangeListener,
} from '@identity.com/solana-gateway-ts';
import './Header.css';
import React from 'react';
import twitter from './socials/Twitter.svg';
import discord from './socials/Discord.svg';
import insta from './socials/Instagram.svg';

export const Header = ({}: {}) => {
    return (
      <body>
        <nav class="navbar">
          <div class="navbar-container container">
            <input type="checkbox" name="" id="" />
            <div class="hamburger-lines">
              <span class="line line1"></span>
              <span class="line line2"></span>
              <span class="line line3"></span>
            </div>
            <ul class="menu-items">
              <li><a href="/home">Gallery</a></li>
              <li><a href="/team">Team</a></li>
              <li><a href="/roadmap">Dog Path</a></li>
              <li><a href="https://twitter.com/TheGoodBoysNFT"><img src={twitter} className="social-logo"></img></a></li>
              <li><a href="https://www.instagram.com/thegoodboysnft/"><img src={insta} className="social-logo"></img></a></li>
              <li><a href="https://discord.gg/fe6xSB8qVz"><img src={discord} className="social-logo"></img></a></li>
            </ul>           
            <h1 class="logo">The Good Boys</h1>
          </div>
        </nav>
      </body>  
    );
  };
